import React from "react";
import "../Style/Nav.css";

const Nav = () => {
  return (
    <div className="nav">
      <img
        className="nav-logo"
        src="http://assets.stickpng.com/images/580b57fcd9996e24bc43c529.png"
        alt=""
      />
      <img
        className="nav-icon"
        src="https://upload.wikimedia.org/wikipedia/commons/0/0b/Netflix-avatar.png"
        alt=""
      />
    </div>
  );
};

export default Nav;
